import React, { useState } from "react";

export default function GroceryDashboard() {
  const [groceries, setGroceries] = useState([
    { id: 1, name: "Milk", price: 2.5 },
    { id: 2, name: "Bread", price: 1.8 },
    { id: 3, name: "Eggs", price: 3.0 },
  ]);
  const [cart, setCart] = useState([]);
  const [newItem, setNewItem] = useState("");

  const addItem = () => {
    if (!newItem.trim()) return;
    setGroceries([
      ...groceries,
      { id: Date.now(), name: newItem, price: (Math.random() * 5 + 1).toFixed(2) },
    ]);
    setNewItem("");
  };

  const addToCart = (item) => {
    setCart([...cart, item]);
  };

  const removeFromCart = (id) => {
    setCart(cart.filter((item, idx) => idx !== id));
  };

  const total = cart.reduce((sum, item) => sum + parseFloat(item.price), 0);

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Navbar */}
      <header className="bg-white shadow px-6 py-4 flex justify-between items-center">
        <h1 className="text-2xl font-bold text-green-600">GroceryPro</h1>
        <div className="flex items-center gap-4">
          <button className="px-3 py-1 rounded bg-green-600 text-white hover:bg-green-700">
            Sign Out
          </button>
        </div>
      </header>

      {/* Layout */}
      <div className="flex">
        {/* Grocery List */}
        <main className="flex-1 p-6 max-w-4xl">
          <div className="mb-6 flex gap-2">
            <input
              type="text"
              placeholder="Add grocery..."
              className="flex-1 border rounded-lg px-4 py-2"
              value={newItem}
              onChange={(e) => setNewItem(e.target.value)}
              onKeyDown={(e) => e.key === "Enter" && addItem()}
            />
            <button
              onClick={addItem}
              className="bg-green-600 text-white px-4 py-2 rounded-lg hover:bg-green-700"
            >
              Add
            </button>
          </div>

          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
            {groceries.map((item) => (
              <div
                key={item.id}
                className="bg-white p-4 rounded-lg shadow hover:shadow-md transition"
              >
                <h2 className="text-lg font-semibold">{item.name}</h2>
                <p className="text-gray-500">${item.price}</p>
                <button
                  onClick={() => addToCart(item)}
                  className="mt-3 w-full bg-green-500 text-white px-3 py-2 rounded hover:bg-green-600"
                >
                  Add to Cart
                </button>
              </div>
            ))}
          </div>
        </main>

        {/* Cart Sidebar */}
        <aside className="hidden lg:block w-80 bg-white shadow-lg h-screen sticky top-0 p-6">
          <h2 className="text-xl font-bold mb-4">Cart</h2>
          {cart.length === 0 ? (
            <p className="text-gray-500">No items in cart</p>
          ) : (
            <>
              <ul className="space-y-3 mb-4">
                {cart.map((item, idx) => (
                  <li
                    key={idx}
                    className="flex justify-between items-center border-b pb-2"
                  >
                    <span>{item.name}</span>
                    <div className="flex items-center gap-2">
                      <span className="text-gray-500">${item.price}</span>
                      <button
                        onClick={() => removeFromCart(idx)}
                        className="text-red-500 hover:text-red-700"
                      >
                        ✕
                      </button>
                    </div>
                  </li>
                ))}
              </ul>
              <div className="font-bold text-lg mb-4">Total: ${total.toFixed(2)}</div>
              <button className="w-full bg-green-600 text-white py-2 rounded hover:bg-green-700">
                Checkout
              </button>
            </>
          )}
        </aside>
      </div>
    </div>
  );
}
